import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Auth from './Components/auth/Auth';
import Notes from './Components/pages/Notes';
import Create from './Components/pages/Create';


const App = () => 
{

  return (
    <div>
          <Router>
            <Switch>
              <Route exact path="/">
                <Auth />
              </Route>
              <Route path="/notes">
                <Notes />
              </Route>
              <Route path="/create">
                <Create />
              </Route>
            </Switch>
          </Router>  
    </div>
  )
}

export default App;
